import {BrowserRouter} from "react-router-dom";
// import 'bootstrap/dist/css/bootstrap.css';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <BrowserRouter>
        <link rel="stylesheet" href="https://rsms.me/inter/inter.css"/>
        <App/>
    </BrowserRouter>
);

reportWebVitals();
